- input: "TEXT\x1CC00108613\x1CX0\x1C\x1CF3XA\x1CPlease note that the Committee is
    amending all reports from January 1, 2005, to present as a result of a comprehensive
    and expansive internal audit in which several financial discrepancies and irregularities
    were discovered.  Please note that from January 1, 2005, through mid 2007, the
    Committee did not correctly report allocable expenses. This issues has been corrected
    on these amendments and has been reported correctly since its discovery in 2007.
    This issue is related to ADR 342.  Furthermore, payments to canvassers during
    Fall 2006 have been included that were omitted from original reports. \n"
